CREATE TABLE ibutler_customer (
    customer_id UUID NOT NULL,
    ibutler_serial_number UUID NOT NULL,
    purchase_date DATE NOT NULL,
    purchase_price DECIMAL(10,2) NOT NULL,
    avg_daily_usage_minutes INT NOT NULL,
    avg_daily_battery_usage_perc DECIMAL(5,2) NOT NULL,
    preferred_usage_time TEXT NOT NULL,
    most_used_feature TEXT NOT NULL,
    location_type TEXT NOT NULL,
    location_no_of_adults INT NOT NULL DEFAULT 0,
    location_no_of_child INT NOT NULL DEFAULT 0,
    avg_daily_error INT NOT NULL DEFAULT 0,
    maintenance_count INT DEFAULT 0,
    last_maintenance_date DATE NULL,
    total_usage_hours INT NOT NULL DEFAULT 0,
    PRIMARY KEY (customer_id, ibutler_serial_number)
);


